INSERT INTO `k_pubs` VALUES ('282359795562496004', null, '在数字时代每个人都是独特的IP', '数字经济的本质是什么，我想现在还不好下定论。社会在发展，随着技术的进步，场景的创新，世界在发生着奇妙的变化，而这种变化往往是遵循着人们的某种需求发展的。社会需要发展，现在的市场经济更喜欢多样化需求，只有需求足够多，机会才足够多。人，是社会的产物，也是社会的基本成员。先知先觉者总在不遗余力地刻画这个世界，道阻且长，冥冥中自有一股力量在推动，帮助人们达成目标，这股力量是对理想不屈的追逐', 'publish', null, null, 'zaishuzishidaimeigerendoushidutedeIP', '0', 'book', '1533544727530094592', '0', null, '0', '1', '0', '40', null, '1', '2023-05-05 22:34:51', '127.0.0.1', '1', '2023-05-05 23:31:54', '127.0.0.1', 'normal', '1');
INSERT INTO `k_pubs` VALUES ('282359821609123842', '<p>为什么说数字时代个人独特更重要</p>\n<p>&nbsp;</p>', '为什么说数字时代个人独特更重要', null, 'inherit', null, null, 'weishenme', '282359795562496004', 'chapter', '1533544727530094592', '0', null, '0', '0', '0', '10', null, '1', '2023-05-05 22:34:57', '127.0.0.1', '1', '2024-02-14 21:04:44', '127.0.0.1', 'normal', '1');
INSERT INTO `k_pubs` VALUES ('285186265536184330', null, '文档模板测试', '知识库文档，与普通合集不同在于支持在在线文档库中集中阅读，拥有条理清晰的导航栏，点击每个文档一级菜单，可以访问对应的文档片段，以锚点的形式展示下级菜单。', 'publish', null, null, 'wendangmobanceshi', '0', 'doc', '1533544727530094592', '0', null, '0', '0', '0', null, null, '1', '2023-06-13 17:46:14', '127.0.0.1', '1', '2023-07-07 21:47:00', '127.0.0.1', 'normal', '1');
INSERT INTO `k_pubs` VALUES ('285186287178792967', '<p>一个文档可以有多篇章节组成，每篇章节可以以标题的形式创建锚点，目前支持markdown格式行文，后期扩大到整个xhtml。</p>\n<h2>二级标题</h2>\n<p>### 这是一个markdown标题 这是正文。 ### 这是第二个标题 这是正文。 #### 这是下一级标题 这是正文</p>\n<p>markdown标签未生效，是因为没有使用markdown专用的编辑器，富文本编辑器把他格式化为html了。</p>\n<p><span style=\"color: #3598db;\">由于明天要上班了</span>，暂时不实现markdown编辑器了，后期有时间再补上。</p>\n<h2>一级标题</h2>\n<p>内容内容内容。</p>\n<p>锚点<a id=\"maodian\"></a></p>\n<p>各种内容。。。。</p>\n<p>锚点2<a id=\"mdian2\"></a>示例</p>\n<p>内容内容。</p>', '这是文档的第一篇内容', null, 'inherit', null, null, '20', '285186265536184330', 'chapter', '1533544727530094592', '0', null, '0', '0', '0', '120', null, '1', '2023-05-13 17:46:19', '127.0.0.1', '1', '2024-02-14 14:46:25', '127.0.0.1', 'normal', '1');
